import React from 'react'

const Projectcomponent = ({name,description,color}) => {
  return (
    <div>
      <div className="logo text-8xl font-bold bg-white w-32 h-32 rounded-full" style={{color:color}}>
        {name.substring(0,1)}
      </div>
      <div className="project-name">
        {name}
      </div>
      <div className="project-description">
        {description}
      </div>
    </div>
  )
}

export default Projectcomponent
